@CutTimeComic @RayvenoirRTs Happy birthday!! 🎉🎉🎉

I was finally able to get an ipad this year, and I love being able to work on art when I'm not at the computer! (Plus my little wacom isn't a screen display one, so drawing on the iPad feels fantastic lol)

P.S. Here's an unrelated but funny pic https://t.co/rkHpo4j4fw

@tunneIsnakes Me: I should start using gradient maps
Me when trying to use a gradient map: Ew I don't like that
Me when looking at posts like this: Wow that looks so cool!

@smackinpackin - russian cuckolding
- man hates shakespeare + his brother gets their family exiled
- cuckolded man is forced to eat nothing but peas

@caffeinecrawls I upgraded to Ex last year &amp; just started a subscription to use it on the iPad (I missed csp too much lol)
It's such a blessing of a program, though my only complaint is that you can't work in CMYK.
Like, there's a thing where you can view the canvas in CMYK &amp; you can export-

@daiwavodkas Cookie Run - A running game and the characters are different flavored/themed cookies.
Mystic Messenger - otoge based in real time. Hourglasses are expensive,,,
Midnight Cinderella is one of my favorite otoges, and it's a classic "you chose who to romance" kind.

@bravelyghost Wow, twinsies!
In all seriousness though, it's exhausting trying to basically be Goldilocks: trying to be emotionally open, but not rambling about your whole life story.
And for me at least, the latter just enflames the former bc if I feel I'm talking too much then I pull back.

@bravelyghost Hmm. They sound like an asshole.
Doing too much of anything will burn you out, ESPECIALLY if it's what you are financially dependant upon.
So anyway they can fuck off and please take care of yourself. Make sure you drink water, stretch every so often, etcetera.

@pokettopom Like, I have a tendency to be That Person™ who's like "you didn't know that? Lmao how could you not know that!" And then realize "wait shit that's mean"
I'm also bad at judging whether something is comedic or just rude
&amp; there's the tendency to want to correct everything ppl say

@apen108 Same
But I'm also intimidated by people I do know 🙃
Pretty much everyone is like, at minimum a 3

@caffeinecrawls Idk what it is but I like creepy weird stuff
Glad to know what to expect; I can't imagine how frustrating it is to go in blind and it triggers something.
I hope you're doing alright now,,,

@Mr_Encyclopedia I mean, I imagine it isn't healthy to assume someone is lying about anything they say, but staying open to the possibility of it being a lie is probably good.
At least, that's kinda what I do.
There was a guy I knew in high school who said all kinds of weird stuff to be edgy...

@honeysaplings @caffeinecrawls ^^^
I need to figure out how to make my drawings have hair look as soft as in yours
(Sorry for the awkward wording, I swear English is my first language lmao)

@daypooooo 😬 that's gotta be rough
I bought a used laptop a few years ago that worked fine for typical college student things, but art files with a high dpi made it struggle
I finally got a new laptop last semester, though the processor is only *slightly* better

@daypooooo Artist: please don’t crash
Computer: haha crash machine go brrrrrrr

One time my computer crash and decided to corrupt a poster I was making for a production and my uni, and I was sooooooo pissed that I had to start all over...

@itskeyon Not having to lug my laptop + wacom around if I wanna do art between classes.
Can draw in bed instead of hunched over at my desk with back pain (it’s so hard to keep myself from leaning forward ._.)

Basically: Convenience.

